__NUXT_JSONP__("/drugs/Tusamitamab_Ravtansine", (function(a,b,c,d){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"2254086-60-5",chebiId:b,chemicalFormula:b,definition:"An immunoconjugate consisting of anti-carcinoembryonic antigen-related cell adhesion molecule 5 (CEACAM5) conjugated to a cytotoxic agent, with potential antineoplastic activity. Upon administration of tusamitamab ravtansine the antibody moiety targets CEACAM5 on tumor cells. Upon antibody\u002Fantigen binding and internalization, the immunoconjugate releases the cytotoxic agent, which results in tumor cell death. CEACAM5, a member of the CEA family of proteins that plays a key role in cell migration, cell invasion, and cell adhesion, is overexpressed by a variety of cancer cell types.",fdaUniiCode:"DSS3BE2ZXN",identifier:"C117229",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C129823","C1512"],synonyms:["ADC SAR408701","Anti-CEACAM5 Antibody-Drug Conjugate SAR408701","SAR408701","TUSAMITAMAB RAVTANSINE",c]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FTusamitamab_Ravtansine",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("Tusamitamab_Ravtansine","","Tusamitamab Ravtansine","2021-10-30T13:19:24.483Z")));